import './App.css';

import Home from "./Home"
import Dashboard from "./Dashboard"
import {Route, Link} from "react-router-dom";

function App() {
  return (
      <div className="App">
        <Route exact path="/" component={Home} />
        <Route exact path="/dashboard" component={Dashboard} />
      </div>
  );
}

export default App;
